import React from 'react';
import './App.css';
import { Route, Routes } from 'react-router-dom'
import LandingPage from './pages/LandingPage/LandingPage';
import CatalogPage from './pages/CatalogPage/CatalogPage';

class App  extends React.Component
{
  constructor(props) {
    super(props)
    this.state = {
      items: [
        {
          id: 1,
          imagе: "/product-images/product-1.png",
          title: "Slimming Gel Body",
          desc: "Гель для тела для похудения",
          price: 69.9,
      },
      {  
          id: 1,
          imagе: "/product-images/product-2.png",
          title: "Slimm Gel ",
          desc: "Лосьон для тела для похудения",
          price: 49.9,
      },
      {
          imagе: "/product-images/product-3.png",
          title: "Slimming Gel ",
          desc: "Масло для тела",
          price: 39.9,
      },
      {
          imagе: "/product-images/product-4.png",
          title: "Gel ",
          desc: "Гель для душа для похудения",
          price: 29.9,
      },
      {
          imagе: "/product-images/product-5.png",
          title: "Slimming Gel ",
          desc: "Лосьон для тела для похудения",
          price: 18.9,
      },
      {
          imagе: "/product-images/product-6.png",
          title: "Slimming Gel ",
          desc: "Лосьон для тела для похудения",
          price: 24.9,
      }
      ]
    }
  }




  render() {
    return (
      <div className="App">
       <Routes>
          <Route path='/' element={<LandingPage></LandingPage>}></Route>
          <Route path='/catalog' element={<CatalogPage></CatalogPage>}></Route>
        </Routes>
      </div>
    );
  }

}

export default App;
